import React from 'react';
import { Form, ImageInput, ImageField } from 'react-admin';


const ImageInputForm = () => {
    return (
        <Form>
            <ImageInput accept={{ 'image/*': ['.png', '.jpg'] }} multiple='false' placeholder={<p>Drop your face image here!</p>}>
                <ImageField source="src" title="title" />
            </ImageInput>
        </Form>

    )
}

export default ImageInputForm;
